const Browse = () => {
  const user = useSelector(store => store.app.user);
  const navigate = useNavigate();
  useEffect(() => {
      if (!user) {
          navigate("/");
      }
  }, []);
  return (
      <div >
          <Header />
          <div>
             <MainContainer />
             <MovieContainer />
          </div>
      </div>
  )
}

export default Browse
